import React from 'react';

const NutritionComparison = (props) =>{
    console.log("NutritionComparison",props)
    return(
        <div className="nutrition-comparison">
            <p>See the the nutrient comparison below</p>
            //add arrow

            <div className="compare-wrapper">
                <div className="comparisons">
                    <NutritionList data={props.data.kibble}/>
                    <NutritionList data={props.data.recipe} brand={true}/>
                </div>
                <p className="padding-bottom-large large-text">Learn about <a href="#" className="orange-text">the role of protein, fat, and carbs</a> in a dog's diet.</p>
                <p className="padding-bottom-large small-text">* All units above are given in grams per 1000 calories (g/kcal).</p>
            </div>

        </div>
    )
}

const NutritionList = (props) =>{
    console.log("HERE", props.data.name.lenght)
    return(
        <div className="nutrition-list">
            {props.brand? <img className="nutrition-image" src="https://www.nomnomnow.com/images/logo_utensils.svg" alt=""/> : <div className="nutrition-image"/>}
            <p className={`name ${props.brand? "black": ""}`}>{props.data.name.substring(0,40)}</p>

        </div>
    )
}
//
// <h2>Protein</h2>
// <p>{props.data.protein}</p>
// <h2>Fat</h2>
// <p>{props.data.fat}</p>
// <h2>Carbohydrate</h2>
// <p>{props.data.carbs}</p>

export default NutritionComparison;
